import React from 'react';

function UploadMuti(){
  const files = [];

  const onChange = (e) => {
    for (let i = 0; i < e.target.files.length; i++) {
      files.push(e.target.files[i]);
    }
  }
  console.log(files);

  return(
    <input type="file" multiple onChange={onChange} />
  )
}

export default UploadMuti;
